169. Majority Element
1.Boyer-Moore majority vote algorithm
O(n) + O(1)
public static int majorityElement(int[] nums) {
    int major = 0, count = 0;
    for (int n: nums) {
        if (count == 0) {
            count++;
            major = n;
        } else if (major == n)  {
            count++;
        } else {
            count--;
        }
    }
    return major;
}

