public int majorityElement3(int[] nums) {
    Map map = new HashMap<>();
    for (Integer n : nums) {
        if (map.containsKey(n)) {
            map.put(n, map.get(n) + 1);
        } else {
            map.put(n, 1);
        }
        if (map.get(n) > nums.length / 2) {
            return n;
        }
    }
    return 0;
}

