215. Kth Largest Element in an Array
1.使用总容量为k+1的优先队列维护值最大的k个点，一旦总数量Y超过k，移除Y中值最小的点。堆中插入和删除的最差时间为O(log(k),log(k)为堆的高度，又因为遍历整个数组，所以时间复杂度为n*log(k)
public int findKthLargest(int[] nums, int k) {
    PriorityQueue q = new PriorityQueue<>();
    for (int num : nums) {
        q.offer(num);
        if (q.size() > k) {
            q.poll();
        }
    }
    return q.poll();
}


使用offer()或者add()方法时会进行排序，这里维护一个小堆。poll()方法移除优先级最高的点，这里是最小值

最大堆可以用Collection.reverseOrder()这个comparator，别的自定义对象需要自己实现comparator


